tables.table_schema:
CREATE TABLE bioreactor_designs (
    id INT PRIMARY KEY,
    design_name VARCHAR(255),
    capacity INT,
    material VARCHAR(50)
);

CREATE TABLE efficiency_metrics (
    id INT PRIMARY KEY,
    bioreactor_id INT,
    efficiency DECIMAL,
    effectiveness DECIMAL
);

CREATE TABLE maintenance_logs (
    id INT PRIMARY KEY,
    bioreactor_id INT,
    maintenance_date DATE,
    maintenance_type VARCHAR(50)
);
